import React from 'react'
import { View } from 'react-native'

const ThirdScreen = () => {
    return (
        <View style={{ flex: 1, justifyContent: 'center', alignItems: 'center' }}>
            <Text>ThirdScreen</Text>
        </View>
    )
}

export default ThirdScreen
